import React from "react";
import CardList from "./cardList";
import {robots} from "./robots";
import SearchBox from "./search_box";

import "./app.css";

const App = (props) => {
	return (
		<div id="wrapper">
			<h1 id="title"> Robo-Friends </h1>
			<SearchBox />
			<CardList robots={robots}/>
		</div>
	);
}

export default App;
